        /// <summary>
        /// 生成SYS11_PrintInfo表的SQL语句
        /// </summary>
        /// <returns></returns>
        public static string GetInsertSQLForCodeItems(List<UdtWip_CodeItems> codeItemList)
        {
            StringBuilder sb = new StringBuilder();
            try
            {
                foreach (var entity in codeItemList)
                {
                    if (string.IsNullOrEmpty(entity.setCode))
                        continue;
                    sb.Append(@"INSERT INTO udtWip_CodeItems(setCode,code,name,visible,note,delFlag,Creator, CreateTime, LastModifier, LastModifyTime  	)");
                    sb.Append("	VALUES(");
                    sb.Append("'" + entity.setCode + "',");
                    sb.Append("'" + entity.code + "',");
                    sb.Append("'" + entity.name + "',");
                    sb.Append("'" + entity.visible + "',");
                    sb.Append("'" + entity.note + "',");
                    sb.Append("'" + entity.delFlag + "',");
                    sb.Append("'" + entity.creator + "',");
                    sb.Append("getdate(),");
                    sb.Append("'" + entity.lastModifier + "',");
                    sb.Append("getdate()");
                    sb.Append("	) \n");
                }
                var bb = sb.ToString();
                return bb;
            }
            catch (Exception e)
            {
                throw e;
            }

        }

